import React from "react";
import { Link } from "react-router-dom";

function Soundtracks() {
  return (
    <div className="soundtracks" style={{ color: "#e5989b" }}>
      <Link to="/soundtracks"></Link>
    </div>
  );
}

export default Soundtracks;
